import React from 'react';
import './Table.css'
import TableRow from './TableRow';

const Table = () => {
  return (
    <table className="result">
      <thead>
        <tr>
          <th>Year</th>
          <th>Total Savings</th>
          <th>Interest (Year)</th>
          <th>Total Interest</th>
          <th>Invested Capital</th>
        </tr>
      </thead>
      <TableRow />
    </table>
  );
};

export default Table;
